import React,{useState} from 'react';
const socket = io('http://localhost:3000');
function Sh(){
    const[mess,setMess]=useState([]);
    socket.on("msg",(msg)=>{
        setMess(msg);
    })
    return(
        <>{mess.map((m,index)=>(
            <h1>{m}</h1>
        ))}
        </>
    )
}
export default Sh;
